import React from 'react';
import { BrowserRouter as Router, Switch, Route, Redirect } from 'react-router-dom';
import { connect } from 'react-redux';
import { PrivateRoute } from './components/PrivateRoute'; // Import your PrivateRoute component

import { Login } from './components/Login';
import { PatientDashboard } from './components/PatientDashboard';
import { DoctorDashboard } from './components/DoctorDashboard';
// ... (other components)

const App = ({ loggedIn }) => {
    return (
        <Router>
            <Switch>
                <Route path="/login" component={Login} />
                <PrivateRoute path="/patient-dashboard" component={PatientDashboard} allowedRoles={['patient']} loggedIn={loggedIn} />
                <PrivateRoute path="/doctor-dashboard" component={DoctorDashboard} allowedRoles={['doctor']} loggedIn={loggedIn} />
                {/* ... (other routes) */}
                <Redirect from="/" to="/login" />
            </Switch>
        </Router>
    );
};

function mapStateToProps(state) {
    const { loggedIn } = state.authentication;
    return {
        loggedIn,
    };
}

const connectedApp = connect(mapStateToProps)(App);
export { connectedApp as App };
